import React from "react";
import { Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle,Row,Col} from 'reactstrap'

function RenderCard({item}) {

  return(
     <div></div>
  );

}

function Home(props) {
    return(
      <div className="container ">
        <div className="row ">
            <Row>
          <Col sm="12" md={{ size: 6, offset: 3 }}><a href="/teletalk"><button className="text-center" color="grey">Why TeleTalk</button></a></Col>
        </Row>
        </div>
      </div>
    );
}

export default Home;
